import { createApp } from 'vue'
import App from './App.vue'
import "bootstrap/dist/css/bootstrap.min.css"
import "bootstrap"
import $ from 'jquery'

createApp(App).mount('#app')

const infoBodies = {
					"azure":"The Internal Leave system allows students to quickly input vacation and business travel requests for advisor approval. Once approved, staff can search, sort, modify, and delete any requests without page reloads. The system also calculates individual leave for each student and determines if they are over their maximum allowed leave for that leave period.\n\nThe ",
					"xibo":"The Internal Leave system allows students to quickly input vacation and business travel requests for advisor approval. Once approved, staff can search, sort, modify, and delete any requests without page reloads. The system also calculates individual leave for each student and determines if they are over their maximum allowed leave for that leave period.\n\nThe ",
					"servers":"The Internal Leave system allows students to quickly input vacation and business travel requests for advisor approval. Once approved, staff can search, sort, modify, and delete any requests without page reloads. The system also calculates individual leave for each student and determines if they are over their maximum allowed leave for that leave period.\n\nThe ",
					};
console.log(infoBodies.leave);

$(".projectContainer.hasMore").not("a").on("click", function(){
	var imgSrc = $(this).find("img").attr('src');
	var projectTitle = $(this).find(".projectTitle").text();
	var projectId = $(this).attr('id');
	$("#infoModal .modal-title").html(projectTitle);
	$("#infoModal .modal-body p").html(infoBodies[projectId].replace(/\n/g, '<br>'));
	$("#infoModal .modal-body img").attr('src', imgSrc);
	console.log(imgSrc);
	console.log(projectId);
	console.log(projectTitle);
});
